import './App.css';

function App() {

  const makeCall = () => {
    fetch('http://localhost:3000/books')
    .then(resp => resp.json())
    .then(console.log)
  }

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <button onClick={makeCall}>clik here</button>
    </div>
  );
}

export default App;
